style5.innerText:
body {
            background-color: #ff6347;
            font-family: sans-serif;
        }
        .container {
            width: 80%;
            margin: 0 auto;
            padding: 20px;
        }
        nav {
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding: 10px;
        }
        .nav-left {
            display: flex;
            align-items: center;
        }
        .nav-right {
            display: flex;
            align-items: center;
        }
        .nav-right i {
            margin-left: 10px;
            font-size: 20px;
        }
        .form-container {
            margin-top: 20px;
        }
        .form-container label {
            display: block;
            margin-bottom: 5px;
        }
        .form-container input[type="text"],
        .form-container input[type="email"],
        .form-container input[type="password"] {
            width: 100%;
            padding: 10px;
            margin-bottom: 10px;
            border: 1px solid #ccc;
            border-radius: 5px;
        }
        .form-container input[type="radio"] {
            margin-right: 5px;
        }
        .form-container input[type="checkbox"] {
            margin-right: 5px;
        }
        .ai-text {
            font-family: monospace;
            margin-top: 20px;
        }
        .select-container {
            margin-top: 20px;
        }
